def count_excellent_numbers(a, b, n, mod=1000000008):

    def generate_good_numbers(a, b):
        s = set()
        for x in range(2, 1 << 8):
            z = 0
            while x > 1:
                z = z * 10 + (a, b)[x & 1]
                x >>= 1
            s.add(z)
        return s

    def factorial_mod(n, mod):
        f = [1] * (n + 1)
        for i in range(1, n + 1):
            f[i] = f[i - 1] * i % mod
        return f
    s = generate_good_numbers(a, b)
    f = factorial_mod(n, mod)
    ans = 0
    for x in range(n + 1):
        if x * a + (n - x) * b in s:
            ans += pow(f[x] * f[n - x], mod - 2, mod)
            ans %= mod
    return ans * f[n] % mod

